column8:
名入れご希望のお客様は”カートに入れる”上部のプルダウンメニューで 名入れ”希望する”を選択してください。
また、ご注文画面に進んで頂き”名入れ文字ご記入欄”にアルファベットで文字をご記入ください。<br><br> 

●Size<br>
ダックス : 約7.8cm<br>
プードルA : 約5.0cm<br>
プードルB : 約5.3cm<br>
※全て鼻からしっぽまでの長さです。<br>
ほねの横幅は約4.4cmです。<br><br>
●Material : 牛革（ヌメ、プレーン）<br><br>

わんちゃんの種類を3タイプの中より、わんちゃんのカラーをそれぞれ4色の中よりお選びいただけます。<br>ほねパーツに無料でお名前お入れします！<br>
ダックスはオフホワイトのほね、プードルAはピンクのほね、プードルBはライトピンクのほねとなります。<br><br>

こちらの商品の名入れパーツの"ほね"は弊社オリジナルブランドhappyではございません。<br>
また、在庫限りの商品となります。<br><br><style type="text/css">
