ギフト対応
デザインとカラーにこだわった大人可愛いキーホルダー♪
ハート・花・と人気パーツを欲張りに組み合わせました。<br>マカロンカラーでイニシャルパーツがお選び頂けます。<br>
●Size: 全長約14.5cm(ストラップ約5cm，本体約9.5cm) 
●Material : 本革（牛革）、スワロフスキーガラス
●Attention: made in japan

